import * as React from 'react';
import Title from './Title';
import TheatersIcon from '@mui/icons-material/Theaters';

export default function CommingSoon({ userInfo }) {

  /* Style */
  const commingSoonSectiontyle = {
    minWidth: '600px',
    maxWidth: '600px',
    minHeight: '150px',
    marginTop: '20px',
    display: 'flex',
    flexDirection: 'row'
  };

  return (
    <>
    <div style={{display:'flex'}}>
      <TheatersIcon style={{marginLeft:'15px',marginRight:'5px' ,marginTop:'3px'}}/><Title>개봉 예정</Title>
    </div>

    <div style={commingSoonSectiontyle}>

    </div>
    </>
  );
}
